  input: TEXT,F3XA,,"(1) Please note that there was a dollar for dollar reimbursement.  The
    difference is reflected in payroll taxes payable to the Internal Revenue Service
    and Indiana Department of Revenue. (2) Funds from the Auditor of Indiana reflect
    payment from individuals who purchase personalized licence plates, which, by state
    law, are forwarded to the political party whose plates are selected.  It is our
    understanding that these are permissible federal dollars. (3) Non of the fundraisers
    on Schedule B were made on behalf of specifically identified federal candidates.  (4)  The
    Report has been amended to disclose the salaries or wages for employees that spend
    more than 25 percent of their time during on activities in connection iwth a Federal
    Election.  (5)  The YTD for Evan Bayh has been corrected.  11/9/2004  the report
    has been amended to reflect the federal candidates or committee share of taxes
    and other expenses."
